bitvec::slice::BitSlice::<T, O>::not_any.doc:
Tests if every bit is cleared to `0` in the bit-slice.

Returns `true` when `self` is empty.

## Examples

```rust
use bitvec::prelude::*;

assert!( bits![].not_any());
assert!(!bits![1].not_any());
assert!( bits![0].not_any());
```

